'''No. 11 Air Experience Flight''' ('''11 AEF''') is one of twelve [[Air Experience Flight| Air Experience Flights (AEFs)]] run by the [[Royal Air Force Air Cadets|Air Cadet Organisation]] of the [[Royal Air Force]]. The primary purpose of the AEF organisation is to provide air experience to members of the [[Air Training Corps]], [[Combined Cadet Force]] (RAF) Section and occasionally, the [[Girls Venture Corps Air Cadets]] and the [[Air Scouts#United Kingdom|Air Scouts]].
== History == No. 11 AEF formed on 8 September 1958 at [[RAF Ouston]] in [[Northumberland]], equipped with [[de Havilland Canada DHC-1 Chipmunk|de Havilland Chipmunk]] T.10 aircraft.<ref name="AofA">{{cite web|url=http://www.rafweb.org/Organsation/RAFVR1.htm|title=No 11 Air Experience Flight|publisher=Air of Authority - A History of RAF Organisation|date=13 February 2016}}</ref>
It later moved to [[RAF Leeming]] then [[Durham Tees Valley Airport|Teesside International Airport]] before returning to Leeming with [[Grob G 115|Grob Tutor T.1]].<ref name="AofA"/>
